snippet.description:
Estamos sacando del cajón cosas que llevaban demasiado tiempo esperando su momento. Palabras escritas hace muchos años, en otra etapa, con otra cabeza, pero con el mismo corazón. Hoy vuelven a respirar. Esto nació hace tiempo, se quedó guardado y ahora por fin ve la luz. Lo escribí hace años, lo grabé hace pocos días. A veces las cosas no llegan tarde, llegan cuando tienen que llegar (L)

